import React from "react";
import {withTranslation} from "../i18n";


const Custom404 = ({t}) => {
    return <h1>{t('pageNotFound')}</h1>
}


Custom404.getInitialProps = async () => ({
    namespacesRequired: ['error']
});

export default withTranslation(['main', 'common'])(Custom404);
